INSERT INTO `nv4_vi_about` (`id`, `title`, `alias`, `image`, `imagealt`, `imageposition`, `description`, `bodytext`, `keywords`, `socialbutton`, `activecomm`, `layout_func`, `weight`, `admin_id`, `add_time`, `edit_time`, `status`, `hitstotal`, `hot_post`) VALUES
(9, 'Giới thiệu Smartline', 'gioi-thieu-smartline', 'logo-smartline.png', 'LOGO SMARTLINE', 0, '', '<p>Trong nền kinh tế kỹ thuật số ngày nay, Công nghệ thông tin (CNTT) thực sự rất cần thiết, đóng vai trò quan trọng đối với hoạt động kinh doanh và thành công của doanh nghiệp.</p>\r\n\r\n<p>Nhưng, môi trường kinh doanh hiện nay cũng mang đến thách thức không hề nhỏ đối với các nhà điều hành doanh nghiệp: họ vừa phải quản trị doanh nghiệp trong sự cạnh tranh khốc liệt từ các đối thủ; quản lý dòng tiền; tìm kiếm, phát triển thị trường mới và tăng lợi nhuận kinh doanh - trong khi vẫn phải tập trung vào việc điều hành, hoạt động hàng ngày của công ty</p>\r\n\r\n<p>Smartline thấu hiểu điều đó – chúng tôi giúp các doanh nghiệp vừa và nhỏ bằng cách định hướng, tư vấn chiến lược về CNTT, cung cấp các giải pháp tối ưu nhằm hỗ trợ tối đa cho mục tiêu kinh doanh và lợi nhuận của doanh nghiệp.</p>\r\n\r\n<p>Smartline là một nhà cung cấp dịch vụ CNTT chuyên nghiệp. Chúng tôi tập trung cung cấp các giải pháp CNTT cho các doanh nghiệp vừa và nhỏ tại Việt Nam. Công việc của chúng tôi là cung cấp các giải pháp CNTT chiến lược, chất lượng cao, duy trì và bảo vệ cơ sở hạ tầng CNTT của các doanh nghiệp.</p>\r\n\r\n<p>Đội ngũ của chúng tôi bao gồm các nhà quản lý dự án cấp cao, tư vấn kỹ thuật về hệ thống, phát triển website, phần mềm và cơ sở dữ liệu và nhóm hỗ trợ IT. Chúng tôi có 1 mục tiêu duy nhất là: Cung cấp các giải pháp công nghệ thông tin độc đáo, chất lượng cao với chi phí hợp lý và thiết lập một mối quan hệ kinh doanh lâu dài với khách hàng của chúng tôi.</p>', 'giới thiệu', 1, '', 'main-about', 1, 1, 1663898064, 1663900716, 1, 35, 0);
