(7, 1, 'CHI PHÍ HỢP LÝ', 'Giúp doanh nghiệp cắt giảm ngân sách dành cho CNTT một cách hợp lý', '', '', 'image-cicle.png', 1661843207, 0, 1),
(8, 2, 'Dịch vụ quản lý IT', 'Các doanh nghiệp giao công việc liên quan tới công nghệ thông tin cho một bên thứ ba cung cấp dịch vụ này.', 'https://smartline.vn/vi/dich-vu-quan-ly-it/it-outsourcing-la-gi-doanh-nghiep-can-chu-y-gi-khi-thue-ngoai-dich-vu-it.html', '', 'synology.png', 1673098896, 0, 1),
(9, 2, 'Quản trị hệ thống', 'Giúp loại bỏ sự đau đầu về hệ thống và cho phép bạn trở lại làm những gì mà bạn làm tốt nhất: thu hút khách hàng và phát triển công việc kinh doanh.', '/index.php?language=vi&nv=quan-tri-he-thong', '', 'synology.png', 1674217690, 0, 1),
(10, 2, 'Dịch vụ máy văn phòng', 'Lắp đặt, bảo trì và sửa chữa các thiết bị văn phòng như máy in, máy quét, máy photocopy và máy fax.', '', '', 'synology.png', 1671289664, 0, 1),
(11, 2, 'Tư vấn triển khai', 'Giúp doanh nghiệp hoạt động hiệu quả và cuối cùng là đạt được lợi nhuận trong kinh doanh.', '', '', 'synology.png', 1671289674, 0, 1),
(4, 1, 'Tầm Nhìn', '<ul>\n	<li>Bảo mật đa tầng, phân quyền linh hoạt</li>\n	<li>Hệ thống bóc tin tự động, đăng bài tự động, cùng nhiều chức năng tiên tiến khác...</li>\n</ul>', 'http://vinades.vn/vi/san-pham/Toa-soan-bao-dien-tu/', '_blank', 'image-eye.png', 1661843017, 0, 1),
(5, 1, 'GIÁ TRỊ CỐT LÕI', '<ul>\n	<li>Tích hợp các tính năng cơ bản bán hàng trực tuyến</li>\n	<li>Tích hợp với các cổng thanh toán, ví điện tử trên toàn quốc</li>\n</ul>', 'http://vinades.vn', '_blank', 'image-setting.png', 1661843028, 0, 1),
(6, 1, 'DỊCH VỤ CHUYÊN NGHIỆP', 'Giúp bạn có thể tiếp cận được với chuyên gia có khả năng và kinh nghiệm', '', '', 'image-cicle.png', 1661843116, 0, 1),
(12, 2, 'Thi công hệ thống', 'Phần mềm và ứng dụng được thiết kế đặc biệt, phát triển và triển khai cho thích hợp, thực hiện theo yêu cầu của khách hàng.', '', '', 'synology.png', 1671289685, 0, 1),
(13, 3, 'Nguyễn Thanh Hoàng', 'Cử Nhân CNTT', '', '', 'logo-smartline.png', 1663734798, 0, 1),
