(18, 3, 'Võ Duy Linh', 'Cử Nhân CNTT', '', '', 'logo-smartline.png', 1663737090, 0, 1),
(20, 5, 'Hệ thống CNTT dẫn đầu', 'Đưa ra nhiều mức dịch vụ, thời hạn hoàn thành, thời gian đáp ứng và các tiêu chí khác đối với các yêu cầu cụ thể của khách hàng trong việc lựa chọn.', '', '', '5.png', 1671644365, 0, 1),
(21, 5, 'HỖ TRỢ NHANH', 'Đáp ứng on-site, thời gian đáp ứng từ 1 – 2h nếu có sự cố xảy ra.', '', '', '8.png', 1671644204, 0, 1),
(22, 5, 'Hệ thống giám sát tốt', 'Giúp cho hoạt động nghiệp vụ của khách hàng đạt hiệu quả cao nhất và hệ thống có độ tin cậy cao nhất.', '', '', '4.png', 1671644400, 0, 1),
(23, 5, 'Đội ngũ IT có trình độ chuyên môn cao', 'Với các chuyên gia công nghệ thông tin có trình độ cao, đạt chứng chỉ quốc tế của chúng tôi có thể giúp khách hàng quản trị hiệu quả hệ thống, hỗ trợ kỹ thuật, tư vấn, giới thiệu và cập nhật các thông tin và công nghệ mới nhất cho khách hàng.', '', '', '7.png', 1671644449, 0, 1),
(24, 4, 'Công ty Travel Plus', 'Các dịch vụ IT của Smartline rất chuyên nghiệp. Luôn đáp ứng tốt và tức thời tất cả các yêu cầu của chúng tôi.', '', '', 'travelplus.png', 1663814941, 0, 1),
(25, 4, 'Công ty Persolkelly', 'Công ty tôi đã làm việc với SMARTLINE 7 năm. Trong những năm đó dịch vụ mà SMARTLINE đem lại là cực tốt. Tôi hài lòng và chúc cho SMARTLINE phát triển.', '', '', 'persolkelly.jpg', 1663815251, 0, 1),
(26, 6, 'Khách hàng ngành Tuyển dụng', '', '', '', 'persolkelly-vanphong.png', 1663817595, 0, 1),
(27, 6, 'Khách hàng ngành thực phẩm', '', '', '', 'good-food-08-1536x1536.jpg', 1663817789, 0, 1),
(28, 4, 'Nhà Máy Sản xuất giấy in nhãn Panoval', 'SMATLINE giúp chúng tôi quản trị và chăm sóc mọi hoạt động về CNTT từ 2009 đến nay để chúng tôi chỉ lo tập trung vào điều hành Doanh nghiệp. Tôi và rất hài lòng về hiệu quả mang lại', '', '', 'logo-panoval-tk.jpg', 1672186853, 0, 1),
(29, 4, 'Công ty Thực Phẩm Tốt Lành GoodFoood', 'Smartline xây dựng hạ tầng máy chủ văn phòng và nhà xưởng chúng tôi một cách chuyên nghiệp, ổng định trong suốt mấy năm chúng tôi sử dụng dịch vụ IT của Smartline', '', '', 'goodfood.jpg', 1672186833, 0, 1),
(30, 6, 'Nhà Máy sản xuất', '', '', '', 'panoval.jpg', 1663819417, 0, 1),
(31, 6, 'Đào tạo giáo dục', '', '', '', 'set_hanoi_resized.jpg', 1663819544, 0, 1),
(32, 7, 'Hệ thống máy chủ', '', '', '', 'server-2.png', 1663833757, 0, 1),
(33, 7, 'Hệ thống mạng', '', '', '', 'switch.png', 1663835997, 0, 1),
(34, 5, 'Cam kết bảo mật', 'Chúng tôi thực hiện công việc dựa trên các quy trình tiêu chuẩn về bảo mật thông tin. Mọi dữ liệu của doanh nghiệp sẽ được chúng tôi mã hóa và bảo mật để phòng tránh virus và bị đánh cắp dữ liệu.', '', '', '1.png', 1673010241, 0, 1),
(35, 5, 'Tiết kiệm chi phí IT', 'Chúng tôi cung cấp nhân sự IT và hỗ trợ giải quyết các vấn đề về kỹ thuật. Do đó, doanh nghiệp của bạn sẽ giảm các chi phí về nhân sự IT. Giúp khách hàng sử dụng hiệu quả chi phí.', '', '', '3.png', 1673010311, 0, 1),
(36, 5, 'Báo cáo mỗi tuần', 'Dịch vụ IT của TSG luôn đảm bảo sự ổn định cho hạ tầng CNTT của doanh nghiệp. Do đó, chúng tôi luôn kiểm tra, bảo trì và tạo báo cáo chi tiết tình trạng hệ thống IT của doanh nghiệp hàng tháng.', '', '', '2.png', 1673010274, 0, 1);
