(16, 6, '6', 0, 1, '', 0, 1663836465, 1663836559, 1, 1, 1663836240, 0, 2, 'IT Helpdesk là gì và con đường phát triển sự nghiệp của nhân viên Helpdesk', 'it-helpdesk-la-gi-va-con-duong-phat-trien-su-nghiep-cua-nhan-vien-helpdesk', 'IT Helpdesk, mới nghe thì có vẻ đơn giản nhưng thực ra cũng làm khá nhiều người cảm thấy khó hiểu và lẫn lộn giữa các khái niệm IT Helpdesk, IT Service Desk… Vậy IT Helpdesk có phải là phòng IT không? Làm IT Helpdesk là làm gì và cơ hội phát triển nghề nghiệp thế nào? Có kiến thức kỹ năng gì để làm một IT helpdesk? Bài viết này sẽ đi giải đáp thắc mắc phần nào các câu hỏi đó.', 'https://itguru.vn/blog/wp-content/uploads/2020/02/Muc-tieu-IT-Helpdesk-300x288.jpg.webp', '', 3, 1, '4', 1, 0, 22, 0, 0, 0, 0, '', 0),
(17, 6, '6', 0, 1, '', 0, 1663836904, 1663836922, 1, 2, 1663836600, 0, 2, 'Thị trường tuyển dụng việc làm IT 2021-2022&#x3A; Nhìn lại và Hướng đến tương lai', 'thi-truong-tuyen-dung-viec-lam-it-2021-2022-nhin-lai-va-huong-den-tuong-lai', 'Thị trường tuyển dụng việc làm IT đã thực sự tiến vào “bình thường mới”? Cùng ITviec nhìn lại ảnh hưởng của năm 2021 đối với xu hướng tuyển dụng nhân viên IT tại Việt Nam và những thay đổi được dự đoán sẽ bùng nổ trong năm 2022.', 'https://itviec.com/blog/wp-content/uploads/2022/03/viec-lam-it-employer-survey-itviec-2022-1-scaled.jpg', '', 3, 1, '4', 1, 0, 22, 0, 0, 0, 0, '', 0),
(18, 6, '6', 0, 1, '', 5, 1673012483, 1673012483, 1, 3, 1438609140, 0, 2, 'Quý IV&#x002F;2014&#x3A; Hầu hết vụ tấn công mạng có nguồn gốc từ Trung Quốc', 'quy-iv-2014-hau-het-vu-tan-cong-mang-co-nguon-goc-tu-trung-quoc', '<strong>Đứng sau Trung Quốc về lưu lượng các cuộc tấn công không gian mạng trong quý IV/2014 không ai khác ngoài Mỹ, theo số liệu vừa được công ty cung cấp dịch vụ đám mây Akamai công bố hôm 25/3.</strong>', '2023_01/7be335477876db854960134c6e137164_xl.jpg', '7be335477876db854960134c6e137164 XL', 1, 1, '4', 1, 0, 7, 0, 0, 0, 0, '', 0),
(19, 6, '6', 0, 1, '', 6, 1673012719, 1673012795, 1, 4, 1427290920, 0, 2, 'Cách nâng cấp Windows 10 Technical Preview qua Windows Update', 'cach-nang-cap-windows-10-technical-preview-qua-windows-update', '<strong>Sử dụng tính năng Windows Update sẵn có trong Windows 7 để nâng cấp phiên bản hệ điều hành mới nhất của Microsoft sẽ dễ dàng hơn so với cách cài mới (clean install). Phương thức này còn giữ lại các thiết đặt, cá nhân hóa và cả những ứng dụng quen thuộc của người dùng. Và đây cũng là điều mà bạn không thể làm được với Windows 8.1.</strong>', '2023_01/windows10_1.jpg', '', 1, 1, '4', 1, 0, 8, 0, 0, 0, 0, '', 0);
