('print', '<strong>[SITE_NAME]</strong>: Tiêu đề website<br /> <strong>[TITLE]</strong>: Tiêu đề<br /> <strong>[USER_ADD]</strong>: Người giao việc<br /> <strong>[USER_WORKING]</strong>: Người thực hiện<br /> <strong>[TIME_START]</strong>: Thời gian bắt đầu<br /> <strong>[TIME_END]</strong>: Thời gian hoàn thành<br /> <strong>[CONTENT]</strong>: Nội dung công việc<br /> <strong>[STATUS]</strong>: Trạng thái<br /> <strong>[TASK_URL]</strong>: URL chi tiết');
